import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHeart } from '@fortawesome/free-solid-svg-icons';

import './CardProducts.scss';

export default function CardProducts({products}) {

    return (
        <div className="card-product">
           {products.map((product,index) => {
            return (
                <div key={index} className="card-product__content">
                    <div className="card-product__content-imgBox">
                        <Link to="">
                            <img src={product.imgUrl}/>
                        </Link>
                        <div className="card-product__content__etiqueta">
                            <span>Añdir al carrito</span>
                        </div>
                    </div>
                    <div className="card-product__info">
                        <div>
                            <p>{product.name}</p>
                            <span>{product.price} €</span>
                        </div>
                        <div>
                            <span><FontAwesomeIcon icon={faHeart}/></span>
                        </div>
                    </div>
                </div>
            )
         })}
        </div>
    )
}

